import AboutUs from "./component/aboutUs/AboutUs";
import ContactUs from "./component/ContactUs";

import Rules from "./component/ruless/Rules";

function App() {
  return (
    <div className="App">
      <AboutUs />
      <Rules />
      <ContactUs />
    </div>
  );
}

export default App;
